import Vue from 'vue';
import VueRouter from 'vue-router';
/*@TODO remove*/
import Testing from '@/views/Testing.vue';
import NewsFeed from '@/views/NewsFeed.vue';
import Blog from '@/views/Blog.vue';
import Community from '@/views/Community.vue';
import MyCommunities from '@/views/MyCommunities.vue';
import Followers from '@/views/Followers.vue';
import Following from '@/views/Following';
import CommunityCreateCommunity from '@/components/Community/CommunityCreateCommunity';
import CommunityEditCommunity from '@/components/Community/CommunityEditCommunity';
import Tagged from '@/views/Tagged';
import TaggedBlogPosts from '@/components/Tagged/TaggedBlogPosts';
import TaggedBlogs from '@/components/Tagged/TaggedBlogs';
import TaggedCommunities from '@/components/Tagged/TaggedCommunities';
import TagShow from '@/views/TagShow';
import TagEdit from '@/views/TagEdit';
import BlogEditBlog from '@/components/Blog/BlogEditBlog';
import Likes from '@/views/Likes';
import LikesBlogPosts from '@/components/Likes/LikesBlogPosts';
import LikesComments from '@/components/Likes/LikesComments';
import Activities from '@/views/Activities';
import EmptyRouter from '@/views/EmptyRouter';

Vue.use(VueRouter);

const routes = [
  {
    path: '/',
    name: 'home',
    component: NewsFeed,
    meta: { createPost: true, page: 'home' },
    children: [
      {
        path: 'post/:postId',
        name: 'home-with-blog-post',
        props: true,
        meta: { createPost: true, page: 'home' }
      }
    ]
  },
  {
    path: '/testing',
    name: 'testing',
    component: Testing
  },
  {
    path: '/blog',
    component: EmptyRouter,
    children: [
      {
        path: ':name/:pagination(\\d+)?',
        name: 'blog',
        props: true,
        meta: { createPost: true, page: 'blog' },
        component: Blog,
        children: [
          {
            path: 'post/:postId',
            name: 'blog-with-blog-post',
            props: true,
            meta: { createPost: true, page: 'blog' },
            component: Blog
          }
        ]
      },
      {
        path: ':id/edit',
        name: 'edit-blog',
        props: true,
        component: BlogEditBlog
      }
    ]
  },
  {
    path: '/blog/:name/likes/',
    props: true,
    component: Likes,
    children: [
      {
        path: ':pagination(\\d+)?',
        name: 'blog-likes',
        props: true,
        meta: {
          showPost: true,
          main: 'likes',
          page: 'blog-likes',
          tabIndex: 0
        },
        component: LikesBlogPosts,
        children: [
          {
            path: 'post/:postId',
            name: 'blog-likes-with-blog-post',
            props: true,
            meta: {
              showPost: true,
              main: 'likes',
              page: 'blog-likes',
              tabIndex: 0
            }
          }
        ]
      },
      {
        path: 'comments/:pagination(\\d+)?',
        name: 'blog-likes-comments',
        props: true,
        meta: {
          showPost: true,
          main: 'likes',
          page: 'blog-likes-comments',
          tabIndex: 1
        },
        component: LikesComments,
        children: [
          {
            path: 'post/:postId',
            name: 'blog-likes-comments-with-blog-post',
            props: true,
            meta: {
              showPost: true,
              main: 'likes',
              page: 'blog-likes-comments',
              tabIndex: 1
            }
          }
        ]
      }
    ]
  },
  {
    path: '/community',
    component: EmptyRouter,
    children: [
      {
        path: ':id/:pagination(\\d+)?',
        name: 'community',
        props: true,
        meta: { createPost: true, page: 'community' },
        component: Community,
        children: [
          {
            path: 'post/:postId',
            name: 'community-with-blog-post',
            props: true,
            meta: { createPost: true, page: 'community' },
            component: Community
          }
        ]
      },
      {
        path: 'create',
        name: 'create-community',
        component: CommunityCreateCommunity
      },
      {
        path: ':id/edit',
        name: 'edit-community',
        props: true,
        component: CommunityEditCommunity
      }
    ]
  },
  /** @TODO revise name */
  {
    path: '/my-communities',
    name: 'my-communities',
    props: true,
    component: MyCommunities
  },
  {
    path: '/followers',
    name: 'followers',
    props: true,
    component: Followers
  },
  {
    path: '/following',
    name: 'following',
    props: true,
    component: Following
  },
  {
    path: '/tag/:synonym?',
    name: 'tag-show',
    props: true,
    component: TagShow
  },
  {
    path: '/tag/:name/edit',
    name: 'tag-edit',
    props: true,
    component: TagEdit
  },
  {
    path: '/tag/:tagNames',
    props: true,
    component: Tagged,
    children: [
      {
        path: 'blogPosts/:pagination(\\d+)?',
        name: 'tagged-blog-posts',
        props: true,
        meta: {
          main: 'tagged',
          createPost: true,
          page: 'tagged-blog-posts',
          tabIndex: 0
        },
        component: TaggedBlogPosts,
        children: [
          {
            path: 'post/:postId',
            name: 'tagged-blog-posts-with-blog-post',
            props: true,
            meta: {
              main: 'tagged',
              createPost: true,
              page: 'tagged-blog-posts',
              tabIndex: 0
            }
          }
        ]
      },
      {
        path: 'blogs/:pagination(\\d+)?',
        name: 'tagged-blogs',
        props: true,
        meta: { main: 'tagged', page: 'tagged-blogs', tabIndex: 1 },
        component: TaggedBlogs
      },
      {
        path: 'communities/:pagination(\\d+)?',
        name: 'tagged-communities',
        props: true,
        meta: { main: 'tagged', page: 'tagged-communities', tabIndex: 2 },
        component: TaggedCommunities
      }
    ]
  },
  {
    path: '/activities',
    name: 'activities',
    component: Activities
  }
];

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
});

export default router;
